import glucosaimg from '../Assets/img/GLUCOSA PROMEDIO_1.png';
import evolucionhemoglobina1 from '../Assets/img/EVOLUCION HEMOGLOBINA GLICOSADA_1.png'
import evolucionhemoglobina2 from '../Assets/img/EVOLUCION HEMOGLOBINA GLICOSADA_2.png'

export default function ResultadosSection() {
  return (
    <section className="resultados-section">
    
      <h3>Resultados</h3>
      

      <p className="subtitulo">• Glucosa promedio:</p>
      <img
        src={glucosaimg}
        alt="Gráfico de glucosa promedio"
        className="grafico-glucosa"
      />

      <p className="subtitulo">• Evolución de la Hemoglobina Glicosilada:</p>
      <div className="imagenes-evolucion">
        <img
          src={evolucionhemoglobina1}
          alt="Informe A1c 1"
          className="grafico-a1c"
        />
        <img
          src={evolucionhemoglobina2}
          alt="Informe A1c 2"
          className="grafico-a1c"
        />
      </div>
    </section>
  );
}
